import "./App.css";

import Navbar from "./component/Navigation/Navbar";
import Home from "./component/Home/Home";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import { Provider as ReduxProvider } from "react-redux";
import { store } from "./store/store";
import Dashboard from "./Feature/Dashboard/Dashboard";
import MyComponent from "./Feature/MyComponent/MyComponent";
import Post from "./Feature/Post/Post";
import CommentComponent from "./Feature/Comment/Comment";

function App() {
  
  return (
    <div className="App">
       <ReduxProvider store={store} >
       <BrowserRouter>
        <Routes>
          <Route path="/" element={<Navbar/>}>
            <Route path="/" element={<Home/>} />
            <Route path="/dashboard/post" element={<Dashboard/>} />
            <Route path="/component" element={<MyComponent/>} />
            <Route path="/dashboard/post" element={<Post/>}/>
            <Route path="/comment" element={<CommentComponent/>} />
          </Route>
        </Routes>
      </BrowserRouter>
       </ReduxProvider>
   
    </div>
  );
}

export default App;
